// useData.js
import { useEffect, useState } from 'react';
import { csv } from 'd3';

export const useData = () => {
    const [data, setData] = useState([]);

    useEffect(() => {
        csv('/datakuuu.csv') // Assumes the CSV file is in the public directory
            .then(rawData => {
                const processedData = rawData.map(row => {
                    const coords = row['Location Coordinates'].split(',').map(coord => +coord.trim());
                    return {
                        Timestamp: new Date(row.Timestamp),
                        HRV: +row.HRV || 0,
                        coords: coords.reverse() // Ensure coords are [longitude, latitude]
                    };
                });

                setData(processedData); // Set the processed data
            })
            .catch(error => {
                console.error("Error loading data:", error);
            });
    }, []);

    return data; // Return processed data for use in components
};
